import  './RrethNe.css';

export class RrethNe extends Component{
    render(){
        return(
            <div>
                <div class="kursi">
                    <h1 class="h">Lab Course</h1>
                    <p>GjatÃ« zhvillimit te lendes LabCourse kemi marr pjes si grup ne kete
                        projekt dhe kemi krijuar webfaqe per zhvillimin e nje sistemi te ankandit online.
                    </p>
                    <h2 class="h">Idea</h2>
                    <p>Kjo ide ka per qellim qe te ndikojm ne zhvillimin e blerjeve online si dhe te kemi produkte me qmime me te lira.</p>
                    <h3 class="h">Realizimi</h3>
                    <p>Permes ketij website mendojm te kemi arritur sa do pak te lehtesojm komunikimin nderjmjet blerseve dhe shiteseve
                        .
                    </p>
                    <h4 class="h">Ekipi yne</h4>
                    <div class="ekipa">
                        <p>Endrit Sadrijaj</p>
                    </div>
                </div>
            </div>
        )
    }
}
